import React from 'react'
import './ContactPage.css'

function AboutPage() {
  return (
    <div className='contact-page'>
    <h2 className='contact-page-text'>Contact Page</h2>
    <p className='contact-page-desc'>
    This web page focuses on selling houses through an online platform, so you can find your best stay at a great price and with reference to the market.
    </p>
    </div>
  )
}

export default AboutPage
